import React from 'react';

import { FormLabel } from 'components';
import { withKnobs, text, boolean, select } from '@storybook/addon-knobs';

export default {
  title: 'FormLabel',
  component: FormLabel,
  decorators: [withKnobs],
};

export const Default = () => {
  const options = ['body2', 'h1', 'h2'];
  const defaultValue = 'h1';
  const type = select('variant', options, defaultValue);
  return <FormLabel variant={type} parseDangerousHtml={boolean('parseDangerousHtml', true)} label={text('Label', 'Primary')} />;
};
